import React from "react";

function About() {
  return (
    <div>
      <div class="card" style="width: 60rem;">
        <div class="card-body">
          <h5 class="card-title">Who am I?</h5>
          <p class="card-text">
            My name is Lois Aleghe and I am a fourth year Software Engineering
            Student at Carleton University. My hobbies include writing,
            listening to music, hanging out with friends and sometimes cooking.{" "}
            <br />
            <br />I love coding in my free time and I do hope one day I would be
            able to create something that the world would benefit from, in other
            words, I hope to make a difference in the world through technology.
            Feel free to contact me and let us create something beautiful
            together :)
          </p>
        </div>
      </div>
    </div>
  );
}

export default About;
